import {motion} from "framer-motion";

export default class Portfolio extends Component {
    render() {
        return (
        <motion.div
        initial={{opacity: 0, x: -100}}
        animate={{opacity: 1, x: 0 }}
        exit={{opacity: 0, x: -100}}
        transition="linear">

        </motion.div>
            
        )
    }
}
